Aàfikún 1
JB-1050AG Full laifọwọyi Duro silinda iboju Tẹ
Awọn ẹya pataki akọkọ:
Iyara giga pẹlu 4000pcs / h (ipele akọkọ ni agbaye) Giga pile dì jẹ to 90cm;
Duro silinda;
Ga konge;
Ori titẹ aiṣedeede pẹlu muyan meji ati eto ifijiṣẹ meji Iboju Fọwọkan;
Eto ifunni ti kii-Duro (Standard) eyiti o le mu iṣẹ ṣiṣe pọ si 30%.
JB-1050A Full laifọwọyi Duro Silinda iboju Tẹ gba awọn kilasika Duro silinda ọna ẹrọ pẹlu awọn anfani bi: iwe be ni deede ati ni imurasilẹ, ga konge, ga iyara, kekere ariwo, ga ìyí adaṣiṣẹ ati be be lo, o dara fun titẹ sita lori seramiki ati ohun elo gilasi, ile-iṣẹ elekitironi (iyipada fiimu, iyipo rọ, nronu mita, tẹlifoonu alagbeka), ipolowo, iṣakojọpọ ati titẹ sita, ami iyasọtọ, gbigbe aṣọ, awọn imọ-ẹrọ pataki ati bẹbẹ lọ.
Ewo ni ọja tuntun ti kikọ sii alapin titẹ iboju silinda.
